  try {
    const {data} = axios.post("https://api.novaposhta.ua/v2.0/json/", {
      apiKey: apiKey,
      modelName: "Address",
      calledMethod: "getSettlementAreas",
      methodProperties: {
        Ref: "",
      },
    });
    return data;
  } catch (error) {
    console.log(error);
  }
};
